import React, { Component } from "react";
import { connect } from "react-redux";
import Button from "@material-ui/core/Button";
import TextField from "@material-ui/core/TextField";
import AccountCircle from "@material-ui/icons/AccountCircle";
import HttpsIcon from "@material-ui/icons/Https";
import Form from "../common/Form";
import * as actions from "./ducks/Register";

const registerContent = [
  {
    id: "0",
    icon: <AccountCircle />,
    text: <TextField id="registerUsername" label="Username" error={false} />,
  },
  {
    id: "1",
    icon: <HttpsIcon />,
    text: <TextField id="registerPassword" label="Password" type="password" />,
  },
  {
    id: "2",
    icon: <HttpsIcon />,
    text: (
      <TextField
        id="registerPassword2"
        label="Reenter Password"
        type="password"
      />
    ),
  },
];
const registerButton = <Button variant="contained">Register</Button>;

class Register extends Component {
  constructor(props) {
    super(props);
    this.state = {
      registerUsername: "",
      registerPassword: "",
      registerPassword2: "",
    };
  }

  handleChange = (e) => {
    this.setState({ [e.target.id]: e.target.value });
  };

  handleRegister = () => {
    //check inputs
    if (
      this.state.registerUsername &&
      this.state.registerPassword &&
      this.state.registerPassword2
    ) {
      console.log("register");
      this.props.register(this.state.registerUsername);
    }
    //return logged in state (which should trigger hoc redirect if logged in)
  };
  render() {
    return (
      <Form
        title="Register"
        formContent={registerContent}
        button={registerButton}
        submit={this.handleRegister}
      />
    );
  }
}

const mapStateToProps = (state) => {
  console.log(state.todoState);
  return {
    registering: state.registerState.register,
  };
};

const mapDispatchToProps = {
  register: actions.register,
};

export default connect(mapStateToProps, mapDispatchToProps)(Register);
